import { IMakeBudgetProps, IResponseGetFurnitureInfosgetFurnitureInfos } from "../../Types/budget";
import pdfMake from 'pdfmake/build/pdfmake'
import pdfFonts from 'pdfmake/build/vfs_fonts'
import { ContextPageSize } from "pdfmake/interfaces";
import { FurnitureOnLocalStorageT } from "../../Types/furnitures";
import Api from "../../Services/Api/api";
import { budgetBaseUrl, furnituresBaseUrl } from "../../Consts/baseURLs";
// TODO: Criar rota para buscar os dados dos móveis.
export default async function generateBudgetInPDF({
    furnitures,
    clientName,
    color,
    tamponade,
    date
}: IMakeBudgetProps)  {
    pdfMake.vfs = pdfFonts.pdfMake.vfs

    async function getFurnitureInfos(
        furnitures: FurnitureOnLocalStorageT[]): 
        Promise<IResponseGetFurnitureInfosgetFurnitureInfos[]>
            {
                const variationIds = furnitures.map(furniture => furniture.variation_id)
                const furnitureTags = furnitures.map(furniture => furniture.furniture_tag)
                const response = await Api.get(budgetBaseUrl.budgetFurnitureInformation, {
                    params: {
                        variation_ids: variationIds,
                        furniture_tags: furnitureTags
                    }
                })

                return response.data
    }

    const makePDFContent = async () => {
        const furnitureInfo = await getFurnitureInfos(furnitures)
        const furnituresFormated = furnitureInfo.map((furniture) => {
            return [
                {text: furniture.furnitureName, style: 'sublabel'},
                {text: [
                    {text: 'Comprimento:', style: 'bold'},
                    {text: furnitures.filter(f => f.furniture_tag === furniture.furnitureTag)[0].length+'m.'},
                ], style: 'indentation'},
                {text: [
                    {text: 'Variação: ', style: 'bold'},
                    {text: furniture.variationName},
                ], style: 'indentation'}
            ]
        })

        return furnituresFormated
    }

    const PDFContent = await makePDFContent()
    
    
    const content: any[]= [
		{text: '1. Móveis do', style: 'header'},
		{text: 'orçamento', style: 'header'},
		
		{text: 'Ambiente orçado: Cozinha', style: 'roomName'},
		{text: [
		    {text: 'Cliente: ', style: 'bold'},
		    {text: 'Gustavo Albuquerque Ramalho da Silva Santos de Medeiros', style: 'client'}
		    ], style: 'indentation'},
	    {text: [
    	    {text: 'Data: ', style: 'bold'},
    	    {text:  new Date().toISOString().substr(0, 10).split('-').reverse().join('/')},
	    ], style: 'indentation'},
		
		{text: 'Características gerais', style: 'label'},
		 {text: [
    	    {text: 'Cor: ', style: 'bold'},
    	    {text: color},
	    ], style: 'indentation'},
	    {text: [
    	    {text: 'Tamponamento: ', style: 'bold'},
    	    {text: tamponade},
	    ], style: 'indentation'},
	    {text: [
    	    {text: 'Ferragens: ', style: 'bold'},
    	    {text:'Blum e cermag'},
	    ], style: 'indentation'},
		
		{text: 'Móveis do orçamento', style: 'label'},
		PDFContent,
	    // {text: [
    	//     {text: 'Tipo de portas:', style: 'bold'},
    	//     {text:' espelho'},
	    // ], marginBottom: 15, style: 'indentation'},
	     
		
        {text: [
            {text: 'Valor: ', style: 'valueLabel'},
            {text: 'R$: 7897,99', style: 'value'}
        ], absolutePosition: {x:70, y:750}},
        {
	        image: 'illustration',
	        width: 250,
            absolutePosition: {x:330, y:550}
		},
		
	]
    const footer = (
        currentPage: number,
        pageCount: number,
        pageSize: ContextPageSize,) => {
            return {
                text: currentPage.toString() + '/' + pageCount,
                alignment: 'right',
                fontSize: 9,
                margin: [0,10,20,0]

            }
    }
    const styles: Object = {
	    header: {
	        fontSize: 40,
	        bold: true
	    },
	    roomName: {
	        fontSize: 15,
	        bold: true,
	        marginTop: 15,
	        marginBottom: 10,
	        marginLeft: 20
	    },
	    label:{
	        bold: true,
	        fontSize: 15,
	        marginTop: 15,
	        marginBottom: 10,
	        marginLeft: 20
	    },
	    sublabel: {
	        bold: true,
	        fontSize: 13,
	        marginTop: 10,
	        marginBottom: 10,
	        marginLeft: 20
	    },
	    valueLabel: {
            fontSize: 20,
            bold: true
	    },
	    value: {
            fontSize: 20,
            bold: true,
            color: '#00A44C'
	    },
        bold: {
            bold: true
        },
        indentation: {
            margin: [20, 0, 0, 0]
        }
	     
	}

    const images: object = {
        illustration: 'data:image/png;base64,'
  }

    pdfMake.fonts = {
        Roboto: {
            normal: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Regular.ttf',
            bold: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Medium.ttf',
            italics: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Italic.ttf',
            bolditalics: 'https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-MediumItalic.ttf'
          },
    }

    const docDefinitions: any = {
        pageSize: 'A4',
        pageMargins: [15, 50, 15, 40],
        content: [content],
        footer: footer,
        styles,
        images,
        defaultStyle: {
            font: 'Roboto'
          }

    }

    console.log(content)

    pdfMake.createPdf(docDefinitions)
        .download(`JN - Orçamento express - ${new Date().toISOString()}.pdf`)
}
